&lt;h3&gt;Magnetic Metal Snaps&lt;/h3&gt;
&lt;p&gt;18mm diameter snaps that couple together very strongly (must be pried apart), rotate freely on the axis, and are electrically conductive. Overall connection resistance is less than 200 miliOhm. Snaps will couple when closer than 10mm.&lt;/p&gt;
